INSERT INTO `t_protocol` VALUES (1, '<p align=\"left\"><b>为使用腾讯企业微信软件（以下简称“本软件”）及服务，用户应当阅读并遵守《腾讯企业微信软件许可及服务协议》（以下简称“本协议”），以及</b><span lang=\"EN-US\"><a href=\"http://www.qq.com/contract.shtml\" target=\"_blank\"><span lang=\"EN-US\"><span lang=\"EN-US\">《腾讯服务协议》</span></span></a><a href=\"http://weixin.qq.com/cgi-bin/readtemplate?uin=&amp;stype=&amp;promote=&amp;fr=&amp;lang=zh_CN&amp;ADTAG=&amp;check=false&amp;nav=faq&amp;t=weixin_agreement&amp;s=default\" target=\"_blank\"><span lang=\"EN-US\"><span lang=\"EN-US\">《腾讯微信软件许可及服务协议》</span></span></a></span><b>等相关协议。请用户务必审慎阅读、充分理解各条款内容，特别是免除或者限制责任的条款，以及开通或使用某项服务的单独协议，并选择接受或不接受。限制、免责条款可能以加粗形式提示用户注意。</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>除非用户已阅读并接受本协议所有条款，否则用户无权下载、安装或使用本软件及相关服务。用户的下载、安装、使用、获取企业微信服务管理帐号及企业微信最终用户帐号（以下简称：企业微信帐号）、登录等行为即视为用户已阅读并同意上述协议的约束。</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\">如果用户未满<span lang=\"EN-US\">18</span>周岁，请在法定监护人的陪同下阅读本协议及其他上述协议，并特别注意未成年人使用条款。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>一、协议的范围</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">1.1&nbsp;</span>协议适用主体范围<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\">本协议是用户与腾讯之间关于用户下载、安装、使用、复制本软件，以及使用腾讯相关服务所订立的协议。“腾讯”是指腾讯公司及其相关服务可能存在的运营关联单位。“企业微信用户”是指注册、登录、使用企业微信软件及服务并获得管理权限的个人或组织，在本协议中更多地称为“你”。“最终用户”是指收到邀请后加入你所创建的企业微信的个人用户。前述“企业微信用户”及“最终用户”统称为“用户”或“所有用户”。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">1.2&nbsp;</span>协议关系及冲突条款<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\">本协议被视为<span lang=\"EN-US\"><a href=\"http://www.qq.com/contract.shtml\" target=\"_blank\"><span lang=\"EN-US\"><span lang=\"EN-US\">《腾讯服务协议》</span></span></a></span>的补充协议，是其不可分割的组成部分，与其构成统一整体。本协议与上述内容存在冲突的，以本协议为准。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\">本协议内容同时包括腾讯可能不断发布的关于本服务的相关协议、业务规则等内容。上述内容一经正式发布，即为本协议不可分割的组成部分，你同样应当遵守。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>二、关于本服务</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">2.1&nbsp;</span>本服务的内容<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\">本服务内容是指腾讯向用户提供的办公管理通讯工具（以下简称“企业微信”），支持单人、多人参与，在发送语音短信、图片和文字等即时通讯服务的基础上，同时为用户提供包括但不限于组织成员管理、通话、企业通讯录以及与其他软件互通等服务（以下简称“本服务”）。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">2.2&nbsp;</span>本服务的形式<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">2.2.1&nbsp;</span>用户使用本服务需要注册企业微信帐号并下载腾讯企业微信客户端软件，腾讯将向用户提供企业微信的管理权限、使用功能和使用说明等服务，并尽应有之努力保障本服务的正常运行。<span lang=\"EN-US\"><br>2.2.2&nbsp;</span>本服务中腾讯企业微信客户端软件提供包括但不限于<span lang=\"EN-US\">Windows</span>、<span lang=\"EN-US\">Mac</span>、<span lang=\"EN-US\">iOS</span>、<span lang=\"EN-US\">Android</span>等多个应用版本（具体以腾讯提供的版本为准），用户必须选择与所安装终端设备相匹配的软件版本。腾讯会不断更新应用版本等，如用户已注册使用一种版本的服务，则可以以同一帐号使用其他版本的服务，本协议自动适用于用户所使用的所有版本的软件和服务。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">2.2.3</span>你可以申请企业微信服务管理帐号，并可通过该管理帐号上传和管理组织成员通讯录，邀请组织成员加入，并通过企业微信实现内部成员沟通、工作互动等目的。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">2.3&nbsp;</span>本服务许可的范围<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">2.3.1&nbsp;</span>腾讯给予用户一项不可转让的、非排他性的许可，以使用本软件。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">2.3.2&nbsp;</span>你可以为使用本软件及服务的目的复制本软件的一个副本，仅用作备份。备份副本必须包含原软件中含有的所有著作权信息。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">2.3.3&nbsp;</span>本条及本协议其他条款未明示授权的其他一切权利仍由腾讯保留，用户在行使这些权利时须另外取得腾讯的书面许可。腾讯如果未行使前述任何权利，并不构成对该权利的放弃。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>三、软件的获取</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">3.1&nbsp;</span>用户可以直接从腾讯的网站上获取本软件，也可以从得到腾讯授权的第三方获取。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">3.2&nbsp;</span></b><b>如果用户从未经腾讯授权的第三方获取本软件或与本软件名称相同的安装程序，腾讯无法保证该软件能够正常使用，并对因此给用户造成的损失不予负责。</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>四、软件的安装与卸载</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">4.1&nbsp;</span></b><b>腾讯可能为不同的终端设备开发了不同的软件版本，用户应当根据实际情况选择下载合适的版本进行安装。</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">4.2&nbsp;</span>下载安装程序后，用户需要按照该程序提示的步骤正确安装。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">4.3&nbsp;</span>为提供更加优质、安全的服务，在本软件安装时腾讯可能推荐用户安装其他软件，用户可以选择安装或不安装。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">4.4&nbsp;</span>如果用户不再需要使用本软件或者需要安装新版软件，可以自行卸载。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>五、软件的更新</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">5.1&nbsp;</span>为了改善用户体验、完善服务内容，腾讯将不断努力开发新的服务，并为用户不时提供软件更新（这些更新可能会采取软件替换、修改、功能强化、版本升级等形式）。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">5.2&nbsp;</span>为了保证本软件及服务的安全性和功能的一致性，腾讯有权不经向用户特别通知而对软件进行更新，或者对软件的部分功能效果进行改变或限制。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">5.3&nbsp;</span>本软件新版本发布后，旧版本的软件可能无法使用。腾讯不保证旧版本软件及相应的客户服务继续可用，请用户随时核对并下载最新版本。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">5.4</span>用户同意，腾讯可能通过公告、更新日志等方式向用户通知软件更新情况，但腾讯不需向用户特别通知。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>六、用户信息及个人信息保护</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.1&nbsp;</span>保护用户信息是腾讯的一项基本原则，腾讯将会采取合理的措施保护用户的信息。除法律法规规定的情形外，未经用户许可腾讯不会向第三方公开、透露用户信息。腾讯对相关信息采用专业加密存储与传输方式，保障用户信息的安全。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.2&nbsp;</span>用户在注册帐号或使用本服务的过程中，需要提供一些必要的个人信息，例如：为向用户提供帐号注册服务或进行用户身份识别，需要填写手机号码；通话功能需要用户授权访问手机通讯录等。若国家法律法规或政策有特殊规定的，用户需要提供真实的身份信息。若用户提供的信息不完整，则无法使用本服务或在使用过程中受到限制。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.3&nbsp;</span>一般情况下，用户可随时浏览、修改自己提交的信息，但出于安全性和身份识别（如号码申诉服务）的考虑，用户可能无法修改注册时提供的初始注册信息及其他验证信息。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.4&nbsp;</span>腾讯将运用各种安全技术和程序建立完善的管理制度来保护用户的个人信息，以免遭受未经授权的访问、使用或披露。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.5</span>你在上传和管理组织成员名称、照片、手机号等个人信息时，请确保你已经事先获得组织成员的明确同意，仅收集为运营及功能实现目的而必需的用户信息，且已充分告知组织成员相关数据收集的目的、范围及使用方式等。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.6&nbsp;</span>企业微信用户应当建立信息安全保护制度并对最终用户进行信息安全教育，包括但不限于：将管理权限交予适当的人选；合理设定相关人员的管理权限；提醒或要求最终用户注意信息安全和帐号安全，防止帐号被他人使用而导致的信息泄露。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.7&nbsp;</span>未经用户的同意，腾讯不会向腾讯以外的任何公司、组织和个人披露用户的个人信息，但法律法规另有规定的除外。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.8&nbsp;</span>腾讯非常重视对未成年人个人信息的保护。若用户是<span lang=\"EN-US\">18</span>周岁以下的未成年人，在使用腾讯的服务前，应事先取得用户家长或法定监护人的书面同意。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.9&nbsp;</span>就你使用本软件及服务过程中所产生的及你所收集或被提供的任何个人信息（“个人信息”），你应根据所有可适用法律法规使用本服务，并依约履行你在本协议下的义务。本协议所指的“可适用法律法规”是指你通过本服务所提供的信息、服务或前述信息、服务可被接收的国家、地区的法律、法规、规章、规范性文件、政策。你承诺：<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.9.1</span>遵守不时修订的所有可适用的隐私和数据保护的法律法规，包括适用于个人信息的法律法规，并向我们提供必要信息以证明你已遵守前述法律法规及本协议约定；<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.9.2&nbsp;</span>仅就使用本软件及本服务之目的使用、处理用户的个人信息，除非最终用户另行授权或同意；<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.9.3</span>明确、准确地向你的最终用户描述你所收集的个人信息以及如何使用、向第三方分享这些信息等；<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.9.4</span>采取适宜的技术及系统的安全措施，以保护个人信息免遭未经授权访问或使用，并对前述安全措施的有效性进行定期测试；<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.9.5&nbsp;</span>确保所有有权访问个人信息的人员都受保密义务的约束；<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.9.6</span>出现任何未经授权的访问或使用个人信息的情况下，及时向腾讯、最终用户和相关数据保护机构汇报；<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.9.7</span>尽可能协助腾讯应对最终用户根据可适用法律法规行使其权利的要求。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">6.10&nbsp;</span>更多有关个人信息和隐私保护的相关政策，请详见<span lang=\"EN-US\"><a href=\"https://work.weixin.qq.com/privacy\"><span lang=\"EN-US\"><span lang=\"EN-US\">《企业微信隐私保护指引》</span></span></a></span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>七、主权利义务条款</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">7.1&nbsp;</span>帐号使用规范<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">7.1.1&nbsp;</span>你在使用本服务前需要注册一个企业微信服务管理帐号，并向最终用户分配最终用户帐号，为验证最终用户所属组织，保障企业微信帐号安全并获得提供服务所必要的用户信息，最终用户需通过手机号码及微信帐号验证后方能使用企业微信帐号。企业微信服务管理帐号可通过微信扫描进行注册<span lang=\"EN-US\">,</span>也可通过企业邮箱、微信企业号授权的方式进行注册。腾讯有权根据用户需求或产品需要对帐号注册方式进行变更。关于你使用帐号的具体规则，请遵守<span lang=\"EN-US\"><a href=\"http://weixin.qq.com/cgi-bin/readtemplate?uin=&amp;stype=&amp;promote=&amp;fr=&amp;lang=zh_CN&amp;ADTAG=&amp;check=false&amp;nav=faq&amp;t=weixin_agreement&amp;s=default\" target=\"_blank\"><span lang=\"EN-US\"><span lang=\"EN-US\">《腾讯微信软件许可及服务协议》</span></span></a><a href=\"http://exmail.qq.com/cgi-bin/bizmail_portal?t=bizmail_eula\"><span lang=\"EN-US\"><span lang=\"EN-US\">《腾讯企业邮箱服务协议》</span></span></a><a href=\"https://mp.weixin.qq.com/cgi-bin/readtemplate?t=home/agreement_tmpl&amp;type=info&amp;lang=zh_CN\" target=\"_blank\"><span lang=\"EN-US\"><span lang=\"EN-US\">《微信公众平台服务协议》</span></span></a></span>&nbsp;<a href=\"https://work.weixin.qq.com/wework_admin/norm\">《企业微信用户帐号使用规范》</a><span lang=\"EN-US\"><ins cite=\"mailto:Tencent%20Ted\" datetime=\"2018-09-25T11:09\"><a id=\"_anchor_1\" onmouseover=\"msoCommentShow(\'_anchor_1\',\'_com_1\')\" onmouseout=\"msoCommentHide(\'_com_1\')\" href=\"https://work.weixin.qq.com/nl/eula#_msocom_1\" language=\"JavaScript\" name=\"_msoanchor_1\"></a></ins></span>相关帐号服务使