\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">10.4&nbsp;</span></b><b>在任何情况下，用户不应轻信借款、索要密码或其他涉及财产的网络信息。涉及财产操作的，请一定先核实对方身份，并请经常留意腾讯有关防范诈骗犯罪的提示。</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>十一、第三方软件或技术</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">11.1&nbsp;</span>本软件可能会使用第三方软件或技术（包括本软件可能使用的开源代码和公共领域代码等，下同），这种使用已经获得合法授权。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">11.2&nbsp;</span>本软件如果使用了第三方的软件或技术，腾讯将按照相关法规或约定，对相关的协议或其他文件，可能通过本协议附件、在本软件安装包特定文件夹中打包、或通过<span lang=\"EN-US\"><a href=\"http://weixin.qq.com/cgi-bin/readtemplate?uin=&amp;t=open_info_collect\" target=\"_blank\"><span lang=\"EN-US\"><span lang=\"EN-US\">开源软件</span></span></a></span>页面等形式进行展示，它们可能会以“软件使用许可协议”、“授权协议”、“开源代码许可证”或其他形式来表达。前述通过各种形式展现的相关协议、其他文件及网页，均是本协议不可分割的组成部分，与本协议具有同等的法律效力，你应当遵守这些要求。<b>如果用户没有遵守这些要求，该第三方或者国家机关可能会对用户提起诉讼、罚款或采取其他制裁措施，并要求腾讯给予协助，用户应当自行承担法律责任。</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">11.3&nbsp;</span></b><b>如因本软件使用的第三方软件或技术引发的任何纠纷，应由该第三方负责解决，腾讯不承担任何责任。腾讯不对第三方软件或技术提供客服支持，若用户需要获取支持，请与第三方联系。</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>十二、免责与责任限制</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">12.1&nbsp;</span>用户理解并同意：本软件及本服务按“如是”的状态提供，腾讯对本服务不作任何明示或暗示的保证，包括但不限于对本服务的可适用性、持续性等。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">12.2&nbsp;</span>用户理解并同意：在使用本服务的过程中，可能会遇到不可抗力等风险因素，使本服务发生中断，因此而引发的损害及后果，腾讯不承担任何责任。不可抗力是指不能预见、不能克服并不能避免且对一方或双方造成重大影响的客观事件，包括但不限于自然灾害如洪水、地震、风暴等以及社会事件如战争、动乱、政府行为等。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">12.3&nbsp;</span>在适用法律允许的范围内，腾讯在任何情况下（不论何种原因）均不承担如下责任：（<span lang=\"EN-US\">A</span>）任何间接的、故意的、惩罚性的、附带的、惩戒性的、特殊的或后果性的损害赔偿<span lang=\"EN-US\">;&nbsp;</span>（<span lang=\"EN-US\">B</span>）业务或机会损失<span lang=\"EN-US\">;&nbsp;</span>（<span lang=\"EN-US\">C</span>）收入损失<span lang=\"EN-US\">;&nbsp;</span>（<span lang=\"EN-US\">D</span>）利润损失<span lang=\"EN-US\">;&nbsp;</span>（<span lang=\"EN-US\">E</span>）商誉损失<span lang=\"EN-US\">;</span>（<span lang=\"EN-US\">F</span>）内容损失<span lang=\"EN-US\">;&nbsp;</span>或（<span lang=\"EN-US\">G</span>）数据丢失。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>十三、知识产权声明</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">13.1&nbsp;</span>腾讯是本软件的知识产权权利人。本软件的一切著作权、商标权、专利权、商业秘密等知识产权，以及与本软件相关的所有信息内容（包括但不限于文字、图片、音频、视频、图表、界面设计、版面框架、有关数据或电子文档等）均受中华人民共和国法律法规和相应的国际条约保护，腾讯享有上述知识产权，但相关权利人依照法律规定应享有的权利除外。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">13.2</span>未经腾讯或相关权利人书面同意，用户不得为任何商业或非商业目的自行或许可任何第三方实施、利用、转让上述知识产权。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>十四、其他</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">14.1&nbsp;</span>用户使用本软件即视为用户已阅读并同意受本协议的约束。腾讯有权在必要时修改本协议条款。腾讯可能会以包括但不限于在相关服务页面展示、网页公告、网页提示、电子邮箱、手机短信、常规的信件传送、用户注册使用本服务的帐号管理系统内发送站内信等方式中的一种或多种，向用户送达关于本服务的各种规则、通知、提示等信息，用户可以在本软件的最新版本中查阅相关协议条款。本协议条款变更后，如果用户继续使用本软件，即视为用户已接受修改后的协议。如果用户不接受修改后的协议，应当停止使用本软件。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\">用户同意，任何由于电子邮箱、手机号码、通讯地址等信息错误或其他不可归咎于腾讯的原因，导致用户未收到相关规则、通知、提示等信息的，均不影响该等信息对用户所产生的法律效力，且用户应受其约束，由此产生的一切后果及责任由用户自行承担。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">14.2&nbsp;</span></b><b>本协议签订地为中华人民共和国广东省深圳市南山区。</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">14.3&nbsp;</span></b><b>本协议的成立、生效、履行、解释及纠纷解决，适用中华人民共和国大陆地区法律（不包括冲突法）。</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">14.4&nbsp;</span></b><b>若用户和腾讯之间发生任何纠纷或争议，首先应友好协商解决；协商不成的，用户同意将纠纷或争议提交本协议签订地有管辖权的人民法院管辖。</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">14.5&nbsp;</span>本协议所有条款的标题仅为阅读方便，本身并无实际含义，不能作为本协议含义解释的依据。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">14.6&nbsp;</span>本协议条款无论因何种原因部分无效或不可执行，其余条款仍有效，对双方具有约束力。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">14.7&nbsp;</span>为方便阅读理解，本协议以中、英文书就，但具体协议条款内容均以本协议中文版本为准。（正文完）</p>', 'CN', '协议1', NULL, NULL, NULL, NULL, b'0', NULL, NULL);
INSERT INTO `t_protocol` VALUES (2, '<p>Welcome to register as a user of Umbrella Insurance. Please read this agreement carefully. If you disagree with any clause of this agreement, you can choose not to register.&nbsp;When you check \"Have read and agree to the \"User Agreement\"\", it means that you confirm the content of this agreement and voluntarily abide by this agreement.&nbsp;If you visit, book or use our products or services on the Little Umbrella Insurance website or other mobile applications or software provided by Umbrella, it is deemed that you fully accept all the terms under this agreement.</p><p>The ownership and operation rights of the services and contents provided by&nbsp;Xiaoyusan Insurance (&nbsp;http://www.xiaoyusan.com/&nbsp;) belong to Shenzhen Muchenglin Technology Co., Ltd. and its affiliates.</p><p>&nbsp;</p><p><b>1. Rules of Use</b><b></b></p><p>1.&nbsp;After you complete the registration application procedures, it means that you have obtained the right to use the Umbrella Insurance account. You are responsible for keeping the user account and password, and you shall be legally responsible for all activities and events conducted with the user account.</p><p>2.&nbsp;When you complete the registration process or use the umbrella insurance service, you should be a natural person, legal person or other organization with full civil capacity.&nbsp;If you do not possess the aforementioned subject qualifications, you will be required to bear all legal responsibilities arising therefrom.&nbsp;When completing the registration, activation or verification process, you should provide your identity information and data according to the prompts on the corresponding page to make it true, timely, complete and accurate; when your identity information and data change, you should be timely Update and accurately provide your identity information and data.</p><p>3.&nbsp;You promise to abide by the seven bottom lines of laws and regulations, the socialist system, national interests, citizens’ legitimate rights and interests, public order, social ethics and information authenticity, and to comply with relevant laws and regulations. The registered information such as account names must not contain illegal or unhealthy information.&nbsp;If you use false information to defraud the account name registration, or your account and other registration information contains illegal and bad information, or use the Umbrella Insurance account to carry out repeated infringements, Umbrella Insurance has the right to notify you to correct, suspend use, or cancel within a specified period of time Measures such as registration.</p><p>4.&nbsp;You should keep your account (user name) and password properly. The actions or actions performed through your account (user name) and password will be regarded as your own behavior, and you will bear the corresponding responsibilities and consequences.&nbsp;If you find that someone else uses your account improperly or has any other situation that may endanger the security of your account, you should immediately notify Umbrella Insurance in a written and effective manner and request Umbrella Insurance to suspend related services.&nbsp;Here, you understand that it takes reasonable time for Umbrella Insurance to take action on your request, and Umbrella Insurance does not assume any responsibility for the consequences (including but not limited to any loss of you) that have occurred before the action is taken.</p><p>5.&nbsp;Under the premise of complying with this service agreement, you will enjoy the user services provided by this website, and will receive information about the latest preferential products and services of Umbrella Insurance.&nbsp;If you are unwilling to accept the information of Umbrella Insurance, you have the right to request Umbrella Insurance to stop sending you product and service information.</p><p>6.&nbsp;You fully understand and agree that, for the information that you publish on the Umbrella Insurance that is suspected of illegal or suspected of infringing on the legal rights of others or violates this agreement, Umbrella Insurance has the right to delete it without notifying you;</p><p>7.&nbsp;You fully understand and agree that you should independently bear all legal responsibilities in your own name if your suspected breach of commitment has caused damage to any third party.</p><p>&nbsp;</p><p><b>2. Privacy Statement</b><b></b></p><p>Umbrella Insurance attaches great importance to the protection of your privacy. Umbrella Insurance will collect your personal information when you voluntarily choose services or provide information, such as company business information, personal identification information, claim information, etc. You understand and agree, The personal information you provide to Umbrella Insurance will be used to provide you with better services, marketing research related to Umbrella Insurance business, and to provide you with related Umbrella Insurance products and services by mail, text message or email And event information.&nbsp;Third parties may contact and use your personal information under necessary circumstances, including authorized employees of Umbrella Insurance, and other companies or personnel that perform work related to our business, marketing activities and data collection from time to time.&nbsp;All such personnel and companies are required to abide by relevant confidentiality agreements, as well as relevant national laws and regulations on the protection of personal information to ensure that your personal information is protected at all times.</p><p><b>&nbsp;</b></p><p><b>3. Disclaimer</b><b></b></p><p>1.&nbsp;You fully understand and agree that if a third party uses your account or changes your data without approval, Umbrella Insurance will not be liable for any damage caused by this situation.</p><p>2.&nbsp;You fully understand and accept the product or service terms of the purchased Umbrella Insurance or the scope of exemption agreed in the agreement. Umbrella Insurance does not bear any liability for damages outside the agreed insurance coverage.</p><p>3.&nbsp;You fully understand and agree that this service involves services such as the Internet and mobile communications, which may be affected by unstable factors in various links.&nbsp;Therefore, any&nbsp;service interruption, cancellation or termination caused&nbsp;by force majeure, computer virus or hacker attack, system instability, user location, user shutdown,&nbsp;GSM&nbsp;network, Internet network, communication line and other reasons that cannot be predicted or controlled by umbrella insurance Umbrella insurance will not be liable for the risks and losses caused by this.</p><p>4.&nbsp;Umbrella insurance requires regular or irregular overhaul or maintenance of the platform or related equipment that provides network services. If this type of situation causes network services (including fee-based network services) to be interrupted within a reasonable time, Umbrella Insurance No need to bear any responsibility for this, but small umbrella insurance should be notified in advance as much as possible.</p><p>5.&nbsp;You fully understand and agree that, except as otherwise provided in this service agreement, due to the particularity of network services, Umbrella Insurance may change, interrupt or terminate some or all of the network services, Umbrella Insurance does not need to bear any responsibility for this , But Umbrella Insurance should give notice as far as possible in advance, and give you as much time as possible to deal with related rights.</p><p>&nbsp;</p><p><b>Four, agreement modification</b><b></b></p><p>1. In&nbsp;accordance with the development of the insurance industry and the Internet and changes in relevant laws, regulations and regulatory documents, or due to business development needs, Umbrella Insurance has the right to modify or change the terms of this agreement. Once the content of this ag